Aggregate puzzle with $match and date comparison<p>I am having a puzzle with comparison of dates.  I have created a simplified story to help illustrate.  Imagine the following collection of documents:</p>

<pre><code>{ 
    "_id" : "A", 
    "t1" : ISODate("2018-01-23T00:00:00.000+0000")
}
{ 
    "_id" : "B", 
    "t1" : ISODate("2018-01-22T00:00:00.000+0000")
}
{ 
    "_id" : "C", 
    "t1" : ISODate("2018-01-21T00:00:00.000+0000")
}
</code></pre>

<p>This is three documents with dates in 2018.</p>

<p>Now imagine an aggregation with a <code>$match</code> entry that looks as follows:</p>

<pre><code>{
  $match:
  {
    "t1": {
      $gte: {
        $dateFromString: {
          dateString: "2017-02-08T12:10:40"
        }
      }
    }
  }
}
</code></pre>

<p>What this should do is match all the documents as the date I am comparing against is back in 2017.  However, what I am finding is that no documents match.  This is the first phase in an aggregation pipeline but with no documents being passed forward, that's the end of the current story.</p>

<p>Can anyone see where I might be going wrong?</p>

